import React , { useState, useEffect } from 'react';
import 'isomorphic-fetch';
import 'es6-promise';
import ReactBootstrap, {InputGroup,FormControl,Nav, Button, Navbar,NavDropdown,Table} from 'react-bootstrap';

import 'bootstrap/dist/css/bootstrap.min.css';


function OrderMngTable() {

	const [myData,setData] = useState([]);

	useEffect(()=>{

		fetch("dummy.json").then(function(resp){
			return resp.json();
		})
		.then(function(data){
			if(data == myData){
				setData(...myData,data)
				console.log("THIS CONSOLE",data)

			}
		})
		.catch(err => {
          // Do something for an error here
          console.log("Error Reading data " + err);
	})
	},[]);
	console.log("THISIS",myData)
			
	 const renderTable = () => {
	    return myData.map(user => {
	      return (
	        <tr>
	          <td>{user.date}</td>
	          <td>{user.order_id}</td>
	          <td>{user.cust_id}</td>
	          <td>{user.address}</td>
	          <td>{user.delivery_items}</td>
	          <td>{user.qty}</td>
	          <td>{user.total}</td>
	          <td>{user.order_type}</td> 
	        
	        </tr>
	      )
	    })
	  }
	return(
			
// https://react-bootstrap.github.io/components/table/
			
			<div>
				<h1 id="title">API Table</h1>
      <table id="users"> 
        <thead>
          <tr>
            <th>Name</th>
            <th>Email</th>
            <th>Address</th>
            <th>Company</th>
          </tr>
        </thead>
        <tbody>{renderTable()}</tbody>
      </table>
    
				
			</div>
		);

}

